// Counting Valleys

/* An avid hiker keeps meticulous records of their hikes. During the last hike that took exactly STEPS  steps, for every step it was noted if it was an uphill, U, or a downhill, D step. Hikes always start and end at sea level, and each step up or down represents a 1 unit change in altitude. We define the following terms:

A mountain is a sequence of consecutive steps above sea level, starting with a step up from sea level and ending with a step down to sea level.

A valley is a sequence of consecutive steps below sea level, starting with a step down from sea level and ending with a step up to sea level.

Given the sequence of up and down steps during a hike, find and print the number of valleys walked through.

Complete the countingValleys function in the editor below.

countingValleys has the following parameter(s):

int steps: the number of steps on the hike
string path: a string describing the path

 */

function countingValleys(steps, path) {
    // Write your code here
    console.log('tracking hike');

    // variable to mark the start of the hike
    let hikeStart = 0;

    // variable to mark the end of the hike
    let hikeEnd = steps - 1;

    // create array to store the distance
    // traveled from the beginning of the hike (0)
    let elevationFromStart = 0;

    // create array to store the distance
    // traveled from the end of the hike (0)
    let elevationFromEnd = 0;

    // create variable to store the 
    // number of valleys travelled in a hike
    let valleysTravelled = 0;

    // loop for as long as the value of hikeStart
    // is less than or equal to hikeEnd 
    while (hikeStart <= hikeEnd) {
        console.log(elevationFromEnd, elevationFromStart);

        /* this conditional will check the hike chronologically and
        reverse-chronologically for the occurance of entrance or exit of a valley */
        if (path[hikeStart] === 'D' && elevationFromStart === 0 ) {
            console.log('Starting down the valley');

            // increment the amount of valleysTravelled by one
            valleysTravelled++

            // decrement elevationFromStart by one
            elevationFromStart--
        } else if (path[hikeStart] === 'D') {
            console.log('Traveling down the path from the beginning');

            // decrement elevationFromStart by one
            elevationFromStart--
        } else if (path[hikeStart] === 'U') {
            console.log('Travelling up the path from the beginning');

            // increment elevationFromStart by one
            elevationFromStart++
        }
        
        if (path[hikeEnd] === 'D' && elevationFromEnd === -1) {
            console.log('Climbing out of the valley');

            // increment the amount of valleysTravelled by one
            valleysTravelled++

            // increment elevationFromEnd by one
            elevationFromEnd++
        } else if (path[hikeEnd] === 'D') {
            console.log('Travelling up the path from the end');

            // increment elevationFromEnd by one
            elevationFromEnd++
        } else if (path[hikeEnd] === 'U') {
            console.log('Travelling down the path from the end')

            // decrement elevationFromEnd by one
            elevationFromEnd--
        }

        // move to the next step from the beginning of
        // the hike
        hikeStart++

        // move to the previous step of the hike from 
        // the end
        hikeEnd--

    } // end while loop
    
    // return the number of valleys travelled
    return valleysTravelled;
}

